import React, { useState } from 'react'

const Logos = (props) => {

  var length_list = Object.keys(props.list_images).length;
  if (props.count <= length_list -3){
    var count1 = props.count
    var count2 = props.count +1
    var count3 = props.count +2
  }
  if (props.count === length_list -2){
      var count1 = props.count
      var count2 = props.count +1
      var count3 = 0
  }
  if (props.count === length_list -1){
    var count1 = props.count
    var count2 = 0
    var count3 = 1
}

  return (
    <div className='studied_images'>
        <img className='first image' src={props.list_images[count1]}></img>
        <img className='second image' src={props.list_images[count2]}></img>
        <img className='third image' src={props.list_images[count3]}></img>
    </div>
  )
}

export default Logos
